import React from 'react';
import SecOne from '../SEC1/secOne.component';
import SecThree from '../SEC3/secThree.component';
import './about-header.style.css';

const AboutHeader = () => (
    <div className='sec0-header'>
        <div className='about-header'>
            <div className='about-header-content'>
                <div className='header-title1'>WE CARE ABOUT</div>
                <div className='header-title2'>YOUR CONCERNS</div>
            </div>
        </div>
        <div>
            <SecOne className='secOne'/>
        </div>
        <div>
            <SecThree className='secThree'/>
        </div>

    </div>

);

export default AboutHeader;
